INSERT INTO `diseaseinfo` VALUES (1,'Theileriosis','چچڑیوں کا بخار','East cost fever - a disease of ruminants caused by the protozoan parasite Theileria parva','یہ بیماری خون کے ایک طفیلی کِرم کی وجہ سے ہوتی ہے۔ اس کی وجہ سے گردن اور اگلی ٹانگوں کے درمیان کے لمفی غدود  سوج جاتے ہیں اور 106oF تک بخار ہو جاتا ہے۔ '),(2,'PPR','کاٹا','An acute highly contagious viral disease of goats, less common in sheep','بکریوں اور بھیڑوں کی شدید متعدی بیماری جو ایک وائرس کی وجہ سے پھیلتی ہے۔ یہ بیماری بھیڑوں سے زیادہ بکریوں میں پائ جاتی ہے۔ '),(3,'Mastitis','حیوانے کی سوزش','Inflammation of the mammary gland and udder, typically due to bacterial infection via a damaged nipple or teat.','تھنوں میں دودھ لانے والے غدودوں کی سوزش جو بیکٹیریا کی وجہ سے ہوتی ہے۔ یہ بیکٹیریا زخمی تھن کے ذریعے حیوانے میں داخل ہو جاتے ہیں۔  '),(4,'Foot and Mouth Disease (FMD)','منہ کھر','FMD is a severe, highly contagious viral disease of livestock with significant economic impact. The disease affects cattle, buffalo and swine as well as sheep, goats, and other cloven-hoofed ruminants.  The disease is easily spreadeable through milk, meat, direct contact and all types of excretions of infected animal','سم دار جانوروں کی متعدی بیماری جو ایک وائرس وجہ سے ہوتا ہے۔ یہ بیماری متاثرہ جانور کے دودھ، گوشت، لعاب، اور تمام قسم کے اخراج سے پھیل سکتی ہے۔'),(5,'Worm Infestation','پیٹ کے کیڑے','Presence of worms inside the body','پیٹ کے اندرونی کِرموں کا پایا جانا'),(6,'Injury Trauma','زخم / چوٹ','Physical injuries of sudden onset and severity which require immediate medical attention','شدید زخم یا چوٹ جس کا فوری علاج کروانا ضروری ہوتا ہے۔'),(7,'GID','گھومنے کی بیماری / گِڈ','Coenurosis/Sturdy -  a parasitic disease of the central nervous system of herbivores. It is caused by the presence of larvae of the tapeworm Taenia multiceps in the brain and resulting in a staggering gait.','یہ بیماری ایک طرح کے طفیلی فیتا نما کیڑے کے جانور کے دماغ میں پلنے کی وجہ سے ہوتی ہے۔ اس میں جانور گول چکر لگاتا ہے اور فالج کا شکار ہو جاتا ہے۔'),(9,'Babesiosis','رت موترا','A disease of cattle and other livestock, transmitted by the bite of ticks. It affects the red blood cells and causes the passing of red or blackish urine.','مویشیوں کی ایسی بیماری جو چچڑی کے کاٹنے سے جسم میں داخل ہوتی ہے۔ یہ خون کے سرخ خلیوں پر اثر انداز ہوتی ہے۔  '),(10,'Drenching Pneumonia','کوئی چیز نگلنے کی وجہ سے ہونے والا نمونیہ','Pneumonia caused by  inhalation of food, stomach acid, medicine or saliva into the lungs',' یہ نمونیا پھیپھڑوں میں خوراک، دوائی یا لعاب کے داخل ہونے کی وجہ سے ہوتا ہے۔ '),(11,'Tick Infestation','جسم پر چچڑی','Ticks/ectoparasites in the skin','جلد پر چچڑیوں کا ہونا'),(12,'Hyperthermia','جِسمانی دَرجہ حَرارَت کا بُہَت زیادہ ہو جانا','Very high fever. Body produces more heat than it can loose. It can be due to some infection or inflammation or blood parasites','بہت شدید / تیز بخار جو کسی انفیکشن یا سوزش یا خون میں موجود کسی طفیلی کیڑے کی وجہ سے ہو سکتا ہے۔'),(15,'Pyrexia/ Infection/ Inflammation','بخار','Fever','انفیکشن/ سوزش'),(16,'Lactic Acidosis','معدے کی تیزابیت','The accumulation of acid in the blood and body tissues,  resulting in a decrease in pH','جسم اور خون میں تیزابیت کی زیادتی'),(17,'Mange Infestation','خارش','A skin disease of mammals caused by parasitic mites ','یہ جلدی بیماری ہے جو ایک طفیلی کیڑے کی وجہ سے ہوتی ہے۔'),(19,'TRP (Traumatic Reticuloperitonitis)','کیل یا دھات کھا جانا','Hardware disease in cattle, caused by the ingestion of a sharp, metallic object','ایک ایسی بیماری جو کویٰ دھات یا  نوکیلی چیز کھانے سے ہوتی ہے۔'),(20,'Digestive System Disorder','ہاضمہ کی خرابی','Pain or discomfort in the stomach associated with difficulty in digesting food','خوراک ہضم کرنے میں مشکل کی وجہ سے معدہ میں تکلیف یا بے آرامی کا ہونا'),(21,'Hypothermia','جِسمانی دَرجہ حَرارَت کا کم ہو جانا','Low body temperature. Body loses more heat than it can produce','جسم کا درجۂ حرارت کا نارمل سے کم ہو جانا'),(22,'Vitamins and Minerals Deficiency','وٹامنز اور نمکیات کی کمی','Causes weakness in body','جسم میں کنزوری کا باعث بنتا ہے۔'),(23,'Milk Fever','سوتک','An acute illness in female cows, goats, etc. that have just produced young, caused by calcium deficiency.','مادہ مویشی جس نے بچہ جنا ہو، اُس کو کیلشیم کی کمی کی وجہ سے یہ بیماری ہو سکتی یے۔ '),(24,'Anthrax','پھُڑکی','A serious bacterial disease of sheep, cattle and other mammals, typically affecting the skin and lungs','یہ حیوانات کی بیماری ایک بیکٹیریا کی وجہ سے ہوتی ہے۔ یہ بیماری جلد اور پھیپھڑوں پر اثر کرتی یے۔  '),(25,'Black Quarter','چوڑے مار','Blackleg/ quarter evil/ quarter ill - an acute infectious and highly fatal, bacterial disease of cattle and sheep manifested by inflammation of the muscles and high mortality.','یہ بیماری ایک بیکٹیریا کی وجہ سے ہوتی ہے۔ یہ مویشی کے اندر شدید انفیکشن پیدا کر دیتی ہے اور انتہائ مہلک ہے۔ اس میں جانور کے پٹھے سوج جاتے ہیں۔ اس بیماری میں مویشیوں کی شرح اموات بہت زیادہ ہے۔    '),(26,'Haemorrhagic Septicaemia','گل گھو ٹو','A severe bacterial disease caused by the bacterium Pasteurella multocida. It primarily affects cattle and water buffalo, but infrequently affects pigs, small ruminants, and other hoof-stock. It is rapidly fatal. The disease is spread through contact with infected animals, contaminated clothing, equipment, and through ingestion or inhalation of the bacteria. Animals under stress or with poor body condition are believed to be more susceptible to P. multicoda infection.','یہ مہلک بیماری پاسٹریلا بیکٹیریا کی وجہ سے پھیلتی ہے۔ اِس بیماری میں بھینس اور گائے زیادہ اثرانداز ہوتے ہیں۔ بعض اوقات یہ بیماری بھیڑ، بکریوں میں بھی آ جاتی ہے۔ کمزور جانور پہلے اس کی زد میں آتا ہے۔ '),(27,'Upper Respiratory Tract Infection','اوپری سانس کی نالی کے انفیکشن','The nose, throat and sinus area-is susceptible to infections caused by a variety of viruses and bacteria','وائرس اور بیکٹیریا کی وجہ سے ناک اور گلے کی انفیکشن ہو جانا'),(28,'Fasciolosis ','فشیولا / جلم','Fascioliasis/ distomatosis/ liver rot - parasitic worm infection caused by the common liver fluke Fasciola hepatica. It mainly affects the liver. It is  zoonosis,  meaning an animal infection that may be transmitted to humans.','جگر کا کرم جو جگر کو نقصان پہنچاتا ہے۔ یہ بیماری، بیمار جانوروں سے انسانوں میں منتقل ہو سکتی ہے۔'),(29,'Urine Retention','پیشاب کی بندش','Inability to empty the bladder completely','پیشاب نہ کر پانا'),(30,'Impaction/Constipation','رکاوٹ / قبض','A bowel obstruction that can occur in various kinds of animals when they consume something that they cannot digest. Once the substance is ingested it will block the digestive tract and, if untreated, cause death','آنتوں کی رکاوٹ جو ایسی چیز کھانے سے ہوتی ہے جو جانور ہضم نہ کر سکے۔ ایسی چیز عمل انہضام کی نالی کو بند کر دیتی ہے۔ اگر اس کا علاج نہ کیا جاۓ تو جانور کی موت واقع ہو سکتی ہے۔ '),(31,'Trypanosomiasis','سسرا','Nagana/nagana pest/ sleeping sickness - caused by trypanosomes - a unicellular parasitic flagellate protozoa','یہ بیماری خون کے ایک طفیلی کِرم - ٹریپنوسوما - کی وجہ سے ہوتی ہے۔ اس میں جانور کمزور ہونے لگ جاتا ہے۔ اونٹوں، گھوڑوں اور گدھوں میں زیادہ پائی جاتی ہے۔ '),(32,'Infectious Pneumonia','متعدی نمونیا','An inflammation of the lungs in response to a disease-causing bacteria.','اس نمونیا کی وجہ سے پھیپھڑوں میں سوزش ہو جاتی ہے۔'),(33,'Tympany/ Bloat','نَفَخ شَکَم','Excessive volume of gas in the rumen','معدہ میں بہت گیس جمع ہو جاتی ہے۔'),(34,'Arthritis','گٹھیا','Painful inflammation and stiffness of joints','جوڑوں میں  درد، سوزش اور اکڑاہٹ  '),(35,'Sheep n Goat Pox','بھیڑ، بکری کے دانے','A highly contagious viral skin disease of sheep and goats','بھیڑوں اور بکریوں کی شدید متعدی جلد کی بیماری جو ایک وائرس کی وجہ سے ہوتی یے۔  '),(36,'Throat Infection','گلے کی انفیکشن','A viral infection, such as a cold or the flu','نزلہ، زکام، کھانسی، بخار جو وائرس یا بیکٹیریا کی وجہ سے ہوتا ہے۔'),(37,'Plant/Feed Toxicity',' زہریلا پودا یا زہریلا کھانا کھانے سے ہونے والی بیماری','The animal gets ill due to poisonous/toxic plants or food','جانور زہریلا کھانا یا زہریلے پودے کھانے سے بیمار ہو جاتا ہے۔'),(38,'Anaplasmosis','اینیپلیسموسِس','A tick-borne disease of cattle, sheep and related ruminants caused by a microorganism called Anaplasma marginale.  It is an infectious disease. The disease is not contagious but is transmitted most commonly by ticks.  It  can also be transmitted via contaminated equipment,  biting flies and mosquitoes. It is also known as yellow-bag or yellow-fever.','مویشیوں کی بیماری جو چچڑیوں کے کاٹنے سے ہوتی ہے۔ یہ ایک مہلک بیماری ہے۔ یہ بیماری متعدی نیہں ہے مگر چچڑیوں، مکھیوں یا مچھروں کے کاٹنے، اور آلودہ اوزار استعمال کرنے سے یہ بیماری پھیل سکتی ہے۔ ،   '),(39,'Jaundice','یرقان','A yellowish or greenish pigmentation of the skin and whites of the eyes due to high bilirubin levels','اس بیماری میں جانور کی جلد اور آنکھوں کا سفید حصہ پیلا پڑ جاتا ہے۔'),(40,'Foot Rot','کُھر کا گلنا','A progressive inflammation of the feet of livestock that is associated with bacterial infection','مویشیوں کے پاؤں میں ہونے والی سوزش جس کا علاج نہ کیا جاۓ تو وہ آہستہ آہستہ بڑھ جاتی ہے۔ یہ ایک بیکٹیریل انفیکشن ہے۔'),(41,'Phosphorus Deficiency','فاسفورس کی کمی','This can happen with grazing animals with low phosphorus content in soil. ','جب جانوروں کو ایسی زمین سے چارہ دیا جاۓ جس میں فاسفورس کی کمی ہو تو جانوروں کے جسم میں فاسفورس کی کمی ہو جاتی ہے۔'),(42,'Infectious Diarrhea','متعدی اسہال',NULL,NULL),(43,'Rabies and Injury','باؤلا پن اور زخم','A contagious and fatal viral disease of dogs and other mammals, transmissible through the saliva to animal and causing madness and convulsions','باؤلا کتا کاٹنے سے زخم ہو جانا یا بیمار ہو جانا ');
