ulty Drenching - drenching performed in a wrong way','غلط طریقے سے دوا پلانا',1),(24,'Feet_lesions',NULL,'Blisters/lesions on feet','پاؤں میں چھالے / زخم',2),(25,'Fever',NULL,'Fever - Rise in temperature','بخار',4),(26,'Gas_accumulation',NULL,'Gas accumulation','پیٹ میں گیس کا جمع ہونا',3),(27,'Hair_loss',NULL,'Hair/Wool loss','بالوں یا اون کا جھڑنا',2),(28,'Hard_feaces',NULL,'Hard feaces','سخت پاخانہ / بڑا پیشاب ',3),(29,'Head_pressing',NULL,'Pressing the head against the wall or any object','سر کو دیوار یا کسی چیز سے دبانا',6),(30,'Very_High_Fever',NULL,'Very High fever - Very High degree temperature','بہت تیز بخار ',4),(31,'Swollen_joints',NULL,'Swelling in joints','جوڑوں میں سوزش',5),(32,'Knee_swelling',NULL,'Knee swelling','گٹھنوں میں سوزش',5),(33,'Lameness',NULL,'Lameness','لنگڑا پن',5),(36,'Milk_abnormalities',NULL,'Milk abnormalities - watery/discoloration/clots/flakes/pus','دودھ پتلا ہونا یا دودھ کی رنگت میں تبدیلی یا دودھ میں  پھٹکیاں اور پس نظر آنا',9),(37,'Milk_reduction',NULL,'Decrease in milk production','دودھ کی پیداوار میں کمی',9),(38,'Mouth_frothing',NULL,'Mouth Frothing - An aggregation of bubbles coming from mouth','منہ  سے جھاگ آنا',2),(39,'Mouth_lesions',NULL,'Blisters/lesions in mouth','منہ میں چھالے / زخم',2),(40,'Nasal_discharge',NULL,'Discharge from nose','ناک سے پانی یا کسی مادے کا بہنا ',1),(41,'Neck_swelling',NULL,'Swelling of the Head and Neck','سر اور گردن میں سوجن',2),(42,'Necrotic_stomatitis',NULL,'Necrotic_stomatitis.  Necrosis - The death of cells or tissues from severe injury or disease; especially in a localized area of the body. Stomatitis - inflammation of the mouth and lips','منہ اور ہونٹوں کی سوزش',2),(43,'Ocular_discharge',NULL,'Discharge from eye(s)','آنکھوں سے پانی یا کسی مادے کا بہنا',2),(44,'Oculonasal_discharge',NULL,'Eyes and nose discharge','آنکھ اور کان سے پانی یا کسی مادے کا بہنا',1),(45,'Off_feed',NULL,'Off-feed - Intake less than normal','کھانے سے بیزاری',3),(46,'Overfeeding',NULL,'Overfeeding','زیادہ کھلا دینا',3)