پر رستے ہوۓ زخم',9),(69,'Udder_inflammation',NULL,'Udder inflammation','حیوانے کی سوزش',9),(70,'Udder_lesion',NULL,'Lesions on udder','حیوانے پر زخم',9),(71,'Urine_block',NULL,'Blockage of urine','پیشاب کا رک جانا',7),(72,'Vaginal_discharge',NULL,'Vaginal discharge','رحم سے کچھ خارج ہونا',7),(73,'Vaginal_infection',NULL,'Vaginal infection','رحم میں انفیکشن',7),(74,'Wasting',NULL,'Wasting - become progressively weaker/thinner','آہستہ آہستہ کمزور ہونا',3),(75,'Weakness',NULL,'Weakness','کمزوری',3),(76,'Weight_loss',NULL,'Weight loss','وزن میں کمی',3),(77,'Worms_in_feaces',NULL,'Worms in feaces','پاخانے / پیشاب میں کیڑے',3),(78,'Wounded',NULL,'Wounded','زخمی',2),(79,'Yellow_eyes',NULL,'Yellow/Pale Eyes','پیلی آنکھیں / زردی مائل آنکھیں',2),(80,'Yellow_mucous_membrane',NULL,'Yellow Mucous Membrane','پیلی لعابی جِھلّی ',2),(81,'Restlessness',NULL,'Restlessness - inability to rest/relax','بے آرامی',6),(82,'Unable_to_stand',NULL,'Unable to stand','کھڑے نہ ہو سکنا',5),(83,'Tremors',NULL,'Tremors/trembling/shaking','جھٹکے آنا یا کانپنا',6),(84,'Increased_heart_rate',NULL,'Increased heart rate','دل کی دھڑکن کا تیز ہو جانا',5),(85,'Itching',NULL,'Itching','خارش',2),(86,'Wheezes',NULL,'Abnormal/wheezing/whistling lungs sounds','پھیپھڑوں میں سے سیٹی کی آواز کا آنا',1),(87,'Difficult_movement',NULL,'Difficulty/pain in movement','حرکت کرنے میں دشواری / تکلیف',5),(89,'Uncoordinated_movements',NULL,'Uncoordinated movements','حرکت کرنے میں بے رابطگی',5),(90,'Red_moist_feet',NULL,'Red and moist feet','سرخ اور نم  پاؤں',2),(91,'Foot_foul_odor ',NULL,'Bad smell from foot','پاؤں سے بدبو آنا',2),(92,'Pica','','Pica-eating foreign material such as bones, dirt, wood, soil or stones','پیکا - ہڈیاں، مٹی، لکڑی، مٹی یا پتھر کھانا',3);
