INSERT INTO `treatment` VALUES (1,'Buparvaquone and Oxytetracycline','بیوپر واقیون، اوکسی ٹیٹرا سائیکلین',1),(2,' Chlortetracycline / Oxytetracycline / Penicillin. Lesions of mouth and nose should be cleaned with mouth wash with 5% boro-glycerine','کلورو ٹیٹرا سائیکلین / اوکسی ٹیٹرا سائیکلین / پینسلین۔ منہ کے چھالوں اور زخموں کو ماؤتھ واش میں 5٪  بورو گلیسرین ملا کر  صاف کریں۔',2),(3,'Combination of Injections Procaine Penciline, Benzyle Peniciline and Streptomycine<br/><br/> Inj. Meloxicam<br/><br/> Washing of ulcerative lesions twice a day with 1% Solution of Potassium Permanganate (pinky) <br/><br/>  Vaccination of healthy animals','پروکین پنسلین، بینزائیل پنسلین اور سٹریپٹو مائسین کے انجیکشنز کو ملا کر لگائیں۔<br/> میلوکسی کیم انجیکشن بھی لگائیں۔<br/> زخموں کو دن میں دو دفعہ پوٹاشیم پرمیگنیٹ (پنکی) کے 1٪ سلوشن  <br/>سے دھوئیں۔  صحت مند جانوروں کی ویکسینیشن کروائیں۔   ',4),(4,'Syp. Albandazole','البنڈازول سیرپ',5),(5,'Oxytetracycline / Procaine Penicillin, Antiseptic Dressing','آکسی ٹیٹرا سائیکلین / پروکین پنسلین، جراثیم کش دوائی سے مرہم پٹی کریں۔',6),(6,'Inj. Oxytetracycline 20 mg/kg and Inj. Imidocarb Dipropionate or Inj. Diminazene Aceturate','آکسی ٹیٹرا سائیکلین انجیکشن 20 میلیگرام/کلوگرام اور امیڈوکارب ڈیپروپیونیٹ انجیکشن یا ڈیمینیزین اسیٹوریٹ انجیکشن',9),(7,'Combination of Injections Procaine penciline, Benzyle peniciline and streptomycine <br/>Flunixin meglumine','پروکین پنسلین، بینزائیل پنسلین اور سٹریپٹومائسین کے انجیکشنز کو ملا کر لگائیں۔ فلونکسن مگلمن',10),(8,'Inj. Ivermectine / Inj. Deltamethrine or Trichlorfon sprays','انجیکشن ائیورمکٹِن، ڈلٹیمتھرِن یا ٹرائیکلورفون سپرے',11),(9,'Inj. Meloxicam, , Fluninxine Meglumine','انجیکشن میلوکسی کیم, فلونکسن مگلمن ',15),(10,'Inj. Ivermectine / Inj. Deltamethrine or Trichlorfon sprays','انجیکشن ائیورمکٹِن، ڈلٹیمتھرِن یا ٹرائیکلورفون سپرے',17),(11,'Balance in diet',' متوازن خوراک ',20),(12,'Multivitamins','ملٹی وٹامنز',21),(13,'Inj. Atropine and Fortified Procaine Pencillin 20/40 LACS','انجیکشن اٹروپین اور فورٹیف